import React, { Component } from 'react';
import axios from 'axios';

const keys = require('../../config/keys');

class YouTubeData extends Component {
  constructor(props) {
    super(props);

    this.state = { data: [] }
  }

  FetchData = async() => {
    alert("you got here");

    // GET YT Analytics API
    axios
      .get(keys.YOUTUBE_ANALYTICS_URI, {
        access_token: this.props.user.accessToken,
        endDate: today,
        ids: this.state.channelName,
        scope: keys.YOUTUBE_SCOPE,
        startDate: yearAgo,
        endDate: '2017-12-31',
        metrics: 'estimatedMinutesWatched,views,likes,subscribersGained',
        dimensions: 'hour',
        sort: 'day'
      })
      .then(response => {
        // Handle success.
        console.log('Well done!');
        console.log(response);
      })
      .catch(error => {
        // Handle error.
        console.log('An error occurred:', error);
      });

  }

  handleChange = ({ target }) => {
    this.setState({
      [target.name]: target.value
    });
  }

  render() {

    if (this.props.user === undefined) {
      var Content = "";
    } else {
      var Content
        <div className="Data">
          <input
            name="channelName"
            type="text"
            placeholder="YouTube Channel Name"
            value={this.state.channelName}
            onChange={this.handleChange}
          />
          <button onClick={this.Login}>Login</button><button onClick={this.FetchData}>Fetch Data</button>
        </div>
    }

    return(
      {Content}
    );
  }
}

export default YouTubeData;
